import React from "react";
import { Container } from "react-bootstrap";
import Image from "react-bootstrap/Image";

const HousePage = () =>{
    const house = {id:1, name: "room-1", address: 'Ул. Союзная, д. 139', description: 'Комфортабельный дом с двумя этажами', price: 20000, img: 'https://www.google.com/url?sa=i&url=https%3A%2F%2Frealnoevremya.ru%2Farticles%2F143273-kottedzh-s-zemley-luchshaya-alternativa-kvartire&psig=AOvVaw2pjaFq5SedCK1g7rdA0XlW&ust=1653928373506000&source=images&cd=vfe&ved=0CAwQjRxqFwoTCNDgq76RhfgCFQAAAAAdAAAAABAD'};

    return (
        <Container className = "mt-2">
            <Image width={300} height={300} src={house.img}/>
            <h2>{house.name}</h2>
            <h3>Price: {house}</h3>
            <p>Addres: {house.address}</p>
            <p>Description: {house.description}</p>
        </Container>
    );
};

export default HousePage;
